import React,{useState,useEffect} from 'react'
import UserMenu from '../../components/Layout/UserMenu'
import Layout from '../../components/Layout/Layout'
import axios from 'axios';
import { useAuth } from '../../context/Auth';
import moment from 'moment'

const Orders = () => {
  const[orders,setOrders]=useState([]);
  const[auth,setAuth]=useAuth();
  //get orders
  const getOrders =async ()=>{
    try {
      const{data}=await axios.get(`${process.env.REACT_APP_API}/api/v1/auth/orders`);
      setOrders(data);
    } catch (error) {
      console.log(error);
    }
  }
  useEffect(()=>{
    if(auth?.token){
      getOrders();
    }
  },[])
  return (
    <Layout title="Dashboard - Orders">
      <div className='container-fluid m-4 p-4'>
        <div className='row'>
          <div className='col-md-3'>
            <UserMenu/>
          </div>
          <div className='col-md-9'>
            <h1 className='text-center'>All Orders</h1>
            {
              orders?.map((o,i)=>{
                return(
                  <div className='border shadow'>
                    <table className='table'>
                      <thead>
                        <tr>
                          <td scope='col'>#</td>
                          <td scope='col'>Status</td>
                          <td scope='col'>Buyer</td>
                          <td scope='col'>Order Date</td>
                          <td scope='col'>Payment</td>
                          <td scope='col'>Quantity</td>
                        </tr>
                      </thead>
                      <tbody>
                        <tr>
                          <th>{i+1}</th>
                          <th>{o?.status}</th>
                          <th>{o?.buyer?.name}</th>
                          <th>{moment(o?.createAt).fromNow()}</th>
                          <th>{o?.payment.success ? "Success":"Failed"}</th>
                          <th>{o?.products?.length}</th>
                        </tr>
                      </tbody>
                    </table>
                    <div className='container'>
                    {cart?.map(p => {
            return <div className="row card mb-2 p-3 flex-row">
              <div className="col-md-4">
                <img src={`${process.env.REACT_APP_API}/api/v1/product/product-image/${p._id}`} className="card-img-top" alt={p.name} height={200} width={200} />
              </div>
              <div className="col-md-4">
                <p>{p.name}</p>
                <p>{p?.description?.substring(0, 30)}</p>
                <p>{p.price}</p>
                <button className="btn btn-danger" onClick={() => removeItem(p._id)}>Remove</button>
              </div>
            </div>
          })}
                    </div>
                  </div>
                )
              })
            }
          </div>
        </div>
      </div>
    </Layout>
  )
}

export default Orders
